const fff = () => {

    const doit = whatever.map((single) => {
       
        return {
          employeeID: single[0].trim(),
          projectID: single[1].trim(),
          daysWorked: Math.round(Math.abs((new Date(single[2]) - new Date(single[3])) / oneDay))
        }
        
      });
}
export default fff;
